import React from 'react';
import { MemoryRouter, Switch, Route } from 'react-router-dom';

import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
// import { LinkContainer } from 'react-router-bootstrap';
// import Button from 'react-bootstrap/Button';
// import ButtonToolbar from 'react-bootstrap/ButtonToolbar';
import Nav from 'react-bootstrap/Nav'
import { Slider } from './components/Slider';
import {  Booking as BookingPage } from './components/Pages/booking';
import './App.css';

const Home = () => <span>Restaurants</span>;
const Booking = () => <span>Booking system</span>;
// const Users = () => <span>Users</span>;

const App: React.FC = () => {
  return (
    <MemoryRouter>
        <Container className="p-3">
            <Jumbotron>
                <h1 className="header">
                Welcome To React-Bootstrap TypeScript Example
                </h1>
            </Jumbotron>
            <h2>
                <Switch>
                    {/* <Route path="/about">
                        <About />
                    </Route> */}
                    <Route path="/booking" component={BookingPage}>
                        <Booking />
                    </Route>
                    <Route path="/">
                        <Home />
                    </Route>
                </Switch>
            </h2>
            <h2>
                {/* <ButtonToolbar className="custom-btn-toolbar">
                    <LinkContainer to="/">
                        <Button>Restaurants</Button>
                    </LinkContainer>
                    <LinkContainer to="/about">
                        <Button>About</Button>
                    </LinkContainer>
                    <LinkContainer to="/users">
                        <Button>Users</Button>
                    </LinkContainer>
                </ButtonToolbar> */}

                <Nav variant="pills" defaultActiveKey="/home">
                    <Nav.Item>
                        <Nav.Link link="/home">Restaurants</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link link="/booking" eventKey="link-1">Manager booking system</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="disabled" disabled>
                        Disabled
                        </Nav.Link>
                    </Nav.Item>
                </Nav>
            </h2>
        </Container>
        <Slider />
    </MemoryRouter>
  );
};

export default App;
